import React from "react";

const count = 1;
const Click = () => {
    return (
        <>
            <span className="incnum">{count}</span>
            <button onClick={IncNum} className="click__me">Click Me</button>
        </>
    )
}

const IncNum = () => {
    return(
        count+=1
    )
}

export default Click;
